import react from 'react';
import "./toggle-button.styles.css"
import ToggleSwitch from 'toggle-switch-react-native'

export const ToggleButton = ({onCheckFunction}) => {
    return (
        <label class="form-switch">
        <input type="checkbox"/>
        <i></i>
        Select Me
        </label>
        
    )
}
